import { FETCH_MOVIE } from "../actions/types";

const INICIAL_STATE = {
  data: []
};

export default (state = [], action) => {
  switch (action.type) {
    case FETCH_MOVIE:
      return { ...state, data: action.payload };
    default:
      return state;
  }
};
